//nolint:revive,govet,errcheck
package development

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_ESC_FIRMWARE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e ESC_FIRMWARE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := ESC_FIRMWARE_UNKNOWN.MarshalText()
		require.NoError(t, err)

		var dec ESC_FIRMWARE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, ESC_FIRMWARE_UNKNOWN, dec)
	})
}
